create table re (
	book_id INT,
	user_id INT,
	reserve_date DATE,
	return_date DATE,
	due DATE
);



update re
set reserve_date = return_date,
	return_date = reserve_date
where reserve_date > return_date;

update re
set due = reserve_date + interval '60 days';

update re 
set return_date = NULL
where reserve_date > '2024-05-01';
